function polymerDestruct(data) {
    var set = data.split("")

    for(i = 0; i < set.length; i++){
        var next = set[i + 1];
    
        // console.log("i: " + i + "  " + set[i] + " " + next + " " +
        // (   next != undefined &&
        //     (set[i] == next.toUpperCase() ||
        //     set[i] == next.toLowerCase()) &&
        //     set[i] != next)
        // );

        if( 
            next != undefined && 
            (set[i] == next.toUpperCase() ||
            set[i] == next.toLowerCase()) &&
            set[i] != next
        ){            
            set.splice(i,2);
            i = -1;
        }else{
            // console.log("skipping " + i);
        }
        // console.log("new: " + set.join(""));
    }   
    return set;
}

